using System;
using System.Drawing;
using System.IO;

namespace QRCodeManager.UnitTests.Helpers
{
    public static class QRGenereatorHelper
    {
        public static string GetBase64String_Id1()
        {
            return "";
        }

        public static byte[] GetByteArray_Id1()
        {
            var bytearray = Convert.FromBase64String(GetBase64String_Id1());
            return bytearray;
        }

        public static Bitmap GetBitmap_Id1()
        {
            var decodedString = Convert.FromBase64String(GetBase64String_Id1());
            var result = default(Bitmap);
            using (var ms = new MemoryStream(decodedString))
            {
                result = new Bitmap(ms);
            }
            return result;  
        }


        public static byte[] BitmapToByteArray(Bitmap value)
        {
            var converter = new ImageConverter();
            var byteArray = (byte[])converter.ConvertTo(value, typeof(byte[]));
            return byteArray;
        }
    }
}
